#a=test
grid=[x for x in a.splitlines()]
w,h = len(grid[0]),len(grid)
start = ([i for i,x in enumerate(grid[0]) if x=="."][0], 0)
end = ([i for i,x in enumerate(grid[-1]) if x=="."][0], h-1)
dirs=[[-1,0],[0,-1],[1,0],[0,1]]
dirStrs="<^>v"

def printTheGrid(seen):
    printGrid=[[y for y in x] for x in a.splitlines()]
    for x,y in seen:
        printGrid[y][x] = "O"
    for y in printGrid:
        print("".join(y))
    print()

def bfs():
    maxDist = 0
    #seen=set({start})
    queue=[[*start,[]]]
    iterations = 0
    while queue:
        if iterations % 10_000 == 0: print(iterations,len(queue),maxDist)
        iterations += 1        
        x,y,path = queue.pop(0)
        dist = len(path)
        if (x,y) == end:
            if dist > maxDist:
                maxDist = dist
        for dirIndex in range(4):
            dx,dy = dirs[dirIndex]
            nx,ny = x+dx, y+dy
            if not (0<=nx<w and 0<=ny<h): continue
            #if (nx,ny) in seen: continue
            if (nx,ny) in path: continue
            value = grid[ny][nx]
            if value == "#": continue
            #if value in dirStrs:
                #if dirStrs.index(value) != dirIndex: continue
                #printTheGrid(path)
            #seen.add((nx,ny))
            queue.append([nx,ny,path+[(nx,ny)]])
    
    return maxDist
print(bfs())